import React, { useEffect, useState } from 'react';
import About from './About';
import Portfolio from './Portfolio';
import Contact from './Contact';




export default function Home() {
    const [text, setText] = useState('');
  const phrase = "I'm Full stack Developer ";
  useEffect(() => {
    let currentIndex = 0;
    const intervalId = setInterval(() => {
      if (currentIndex <= phrase.length) {
        setText(phrase.substring(0, currentIndex));
        currentIndex++;
      } else {
        currentIndex = 0; // Reset currentIndex
        setText(''); // Reset text
      }
    }, 200); // Adjust typing speed here

    return () => clearInterval(intervalId);
  }, []);
  
    return (
           <>
         

        <div className="container mt-5 d-flex  ">
            <div className="row">
                <div className="col-lg-6 mt-3">
                    <h3 >Hello !<span id="h31" className="text-red"> I'm Abdelmajid S'bai</span></h3>
                    <h3><span style={{ color: 'blue' }}>{text}</span><span className="text-red">|</span></h3>
                    <button className="btn btn-primary mt-3" id="aboutme">About Me</button>

                    
                </div>
                <div className="col-lg-6 mt-5 border=">
                    <div className="myphoto ">
                    <img  src="/myphotos/photo.jpg" alt="My Photo" className=""/>
                    </div>
                </div>
                

            </div>
        </div> 

        <About/>
        <Portfolio/>
        <Contact/>
        
        
        

        

               
           </>
      
      
)
}
